import React from "react";

export const ContactPicker = ( {contacts, value, name} ) => {
  return (
    <select 
    onChange={(e) => {
      setContact(e.target.value);}}
      value={value}
      name={name}
      >
      <option value="">
        No Contact Selected
      </option>
      {contacts.map((contact, index) =>
      <option key={index+1} value={contact.name}>
        {contact.name}
      </option>
      )}
      </select>
  );
};
